import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Navbar from './Navbar';

function Home() {
    return (
        <BrowserRouter>
            <Navbar />
            <div className='h2'>Home</div>
        </BrowserRouter>
    )
}

export default Home
